    // Top Level Domain
    string public tld;
    // owner address
    address payable public owner;

    mapping(string => string) public domains;
    mapping(string => string) public records;
    mapping(uint => string) public names;

    modifier onlyOwner() {
        require(isOwner());
        _;
    }

    /**
     * constuctor
     * @param _tld top level domain
     */
    constructor(string memory _tld) payable ERC721("DID Name Service", "DNS") {
        // owner addressを設定する。
        owner = payable(msg.sender);
        tld = _tld;
    }

    /**
     * register
     * @param name domain
     * @param did did
     * @param to address
     */
    function register(
        string calldata name,
        string calldata did,
        address to
    ) public payable {
        require(!valid(name), "invalid domain name check length");

        // name + tld
        string memory _name = string(abi.encodePacked(name, ".", tld));
        // create image data
        string memory finalSvg = string(
            abi.encodePacked(svgPartOne, _name, svgPartTwo)
        );
        //　get token ID
        uint256 newRecordId = _tokenIds.current();
        uint256 length = StringUtils.strlen(name);
        string memory strLen = Strings.toString(length);

        // encode
        string memory json = Base64.encode(
            abi.encodePacked(
                '{"name": "',
                _name,
                '", "description": "A domain on the Ninja name service", "image": "data:image/svg+xml;base64,',
                Base64.encode(bytes(finalSvg)),
                '","length":"',
                strLen,
                '"}'
            )
        );
        // generate URI
        string memory finalTokenUri = string(
            abi.encodePacked("data:application/json;base64,", json)
        );

        // mint NFT
        _safeMint(to, newRecordId);
        // token URO
        _setTokenURI(newRecordId, finalTokenUri);

        // register
        domains[name] = did;
        names[newRecordId] = name;
        _tokenIds.increment();
    }

    /**
     * get name
     * @param name domain
     */
    function getAddress(
        string calldata name
    ) public view returns (string memory) {
        return domains[name];
    }

    /**
     * set record
     * @param name domain
     * @param record data
     */
    function setRecord(string calldata name, string calldata record) public {
        // register
        records[name] = record;
    }

    /**
     * get record data
     * @param name name
     */
    function getRecord(
        string calldata name
    ) public view returns (string memory) {
        return records[name];
    }

    /**
     * check owner
     */
    function isOwner() public view returns (bool) {
        return msg.sender == owner;
    }

    /**
     * gell all names
     */
    function getAllNames() public view returns (string[] memory) {
        string[] memory allNames = new string[](_tokenIds.current());
        for (uint i = 0; i < _tokenIds.current(); i++) {
            allNames[i] = names[i];
        }
        // 返却する。
        return allNames;
    }

    /**
     * check domain name
     */
    function valid(string calldata name) public pure returns (bool) {
        return StringUtils.strlen(name) >= 3 && StringUtils.strlen(name) <= 10;
    }
}

